import React from 'react'
import "./index.css"
import sample from"./sample.jpg"

function Sale(){
    return(
        <>
        <div className="box-5">
     	<img src={sample} alt="user-panel" height="110px" width='93%' align="center" />
     </div>
        </>
    )
}
export default Sale;
